{"1": {"comment_id": "halloweenjackfruit"  "comment_text": "Been walking around city centre and up 343 steps to St Stephen's Church tower so was hungry for late lunch. Wanted to try one of the #Venuss branches. Their #lasagne is gorgeous and got the option of 6 items from salad bar as well (glad I didn't go for large 9 item one as this filled me up!). Got #pumpkin #beetroot #lentil some vegan egg thing  asian salad  sprouts on top. Drinking oat #matchalatte again.
To be able to eat so healthy in vegan places on holiday is amazing. I didn't sleep until 3am so felt tired in the morning (set alarm to get breakfast items before 10am although I might just miss the crappy breakkie tomorrow and go out to eat instead) which means good food is much needed!

